import React from "react";
import { Link } from "react-router-dom";
import { useLogout } from "../hooks/useLogout";

function Navbar() {
  const { logout } = useLogout();
  return (
    <header>
      <div>
        <Link to="/">
          <h3>Gym_Growth</h3>
        </Link>
        <Link to="/login">login</Link>
        <Link to="/register">register</Link>
      </div>
    </header>
  );
}

export default Navbar;
